################################

ascii_banner = pyfiglet.figlet_format("ViralQuest")

usage = f"""
{print(ascii_banner)} A tool for viral diversity analysis. More info in: https://github.com/gabrielvpina/ \n
Dependencies: CAP3; Diamond; BLAST; HMMER and ORFiPy.
"""

parser = argparse.ArgumentParser(description=usage)

parser.add_argument("-in", "--input", type=str, dest="input", required=True,
                    help="Fasta file containing non-host contigs to be analyzed.")

parser.add_argument("-out", "--outdir", type=str, required=True,
                    help="Directory where the output files will be saved.")

parser.add_argument("--cap3", action="store_true", 
                    help="Activate CAP3 fasta assembly: Deactivated by default.")

parser.add_argument("-N", "--blastn", type=str, 
                    help="Path to the BLASTn database for nucleotide sequence comparison.")

parser.add_argument("-dX", "--diamond_blastx", type=str, dest="diamond_blastx",
                    help="Path to the Diamond BLASTx database for protein sequence comparison.")

parser.add_argument("-rvdb", "--rvdb_hmm", type=str, dest="rvdb_hmm",
                    help="Path to the RVDB hmm for conserved domain analysis.")

parser.add_argument("-eggnog", "--eggnog_hmm", type=str, dest="eggnog_hmm",
                    help="Path to the EggNOG hmm for conserved domain analysis.")

parser.add_argument("-vfam", "--vfam_hmm", type=str, dest="vfam_hmm",
                    help="Path to the Vfam hmm for conserved domain analysis.")

parser.add_argument("-pfam", "--pfam_hmm", type=str, dest="pfam_hmm",
                    help="Path to the Pfam hmm for conserved domain analysis.")

parser.add_argument("-norf", "--numORFs", type=int, dest="numORFs",
                    help="Number of largest ORFs to select from the input sequences.", default=2)

parser.add_argument("-cpu", "--cpu", type=int, dest="cpu",
                    help="Number of CPU cores to be used for computation.", default=2)

parser.add_argument("-dmnd_path","--diamond_path", type=str, dest="diamond_path",
                    help="OPTIONAL - Diamond bin application path for BLAST databases: path/to/./diamond", default="None")

parser.add_argument("-v", "--version", action="version", 
                    version=f"ViralQuest v{__version__}")

args = parser.parse_args()

####################################

if not args.input:
    parser.error("The --input argument is required. Please provide a valid input file.")
if not args.outdir:
    parser.error("The --outdir argument is required. Please specify an output directory.")


####################################

# Debugging information
print(f"Input file: {args.input}")
print(f"Output directory: {args.outdir}")
print(f"Number of ORFs: {args.numORFs}")
print(f"CPU cores: {args.cpu}")
if args.blastn:
  print(f"BLASTn database: {args.blastn}")
if args.diamond_blastx:
  print(f"Diamond BLASTx database: {args.diamond_blastx}")
if args.rvdb_hmm:
  print(f"RVDB hmm Protein database v29.0: {args.rvdb_hmm} ")
if args.vfam_hmm:
  print(f"Vfam hmm 228: {args.rvdb_hmm} ")
if args.eggnog_hmm:
  print(f"EggNOG hmm version 4.5: {args.rvdb_hmm} ")
if args.pfam_hmm:
  print(f"Pfam hmm Protein family: {args.pfam_hmm} ")


####################################

if not args.blastn and not args.diamond_blastx:
    parser.error("At least one of --blastn, --blastx, or --diamond_blastx must be specified.")

####################################

def ViralQuest():
    time_start = time.time()
    steps = [
        "Processing FASTA",
        "Finding ORFs",
        "HMMsearch-RVDB" if args.rvdb_hmm else None,
        "HMMsearch-Vfam" if args.vfam_hmm else None,
        "HMMsearch-EggNOG" if args.eggnog_hmm else None,
        "HMMsearch-Pfam" if args.pfam_hmm else None,
        "Running BLASTx" if args.diamond_blastx else None,
        "Running BLASTn" if args.blastn else None,
        "Generating final table"
    ]
    steps = [step for step in steps if step is not None]  # Remove None steps

    with tqdm(total=len(steps), desc="Pipeline Progress", unit='steps') as progress_bar:

        ### Processing FASTA      
        if args.cap3:
            progress_bar.set_description("Processing FASTA")
            cap3(args.input, args.outdir)
            renameFasta(args.outdir)
            progress_bar.update(1)
        else:
            progress_bar.set_description("Processing FASTA")
            noCAP3(args.input, args.outdir)
            filterfasta(args.outdir)
            renameFasta(args.outdir)
            progress_bar.update(1)

        ### ORFs profile
        progress_bar.set_description("Finding ORFs")
        findorf(args.outdir)
        ORFs(args.outdir, args.numORFs)
        progress_bar.update(1)

        ### HMM Search
        if args.pfam_hmm and not args.rvdb_hmm or not args.eggnog_hmm or not args.vfam_hmm:
          print("Error: --pfam_hmm requires --rvdb_hmm/--eggnog_hmm/--vfam_hmm to be specified.", file=sys.stderr)
          sys.exit(1)

        if args.rvdb_hmm:
            progress_bar.set_description("HMMsearch-RVDB")
            process_RVDB(args.outdir, args.rvdb_hmm, args.cpu, score_threshold=100)
            progress_bar.update(1)

        if args.vfam_hmm:
            progress_bar.set_description("HMMsearch-Vfam")
            process_VFAM(args.outdir, args.vfam_hmm, args.cpu, score_threshold=100)
            progress_bar.update(1)    

        if args.eggnog_hmm:
            progress_bar.set_description("HMMsearch-EggNOG")
            process_EggNOG(args.outdir, args.eggnog_hmm, args.cpu, score_threshold=100)
            progress_bar.update(1)  


        progress_bar.set_description("HMMsearch-Pfam")
        pfamFasta(args.outdir)
        process_Pfam(args.outdir, args.pfam_hmm, args.cpu)
        generateFasta(args.outdir)
        progress_bar.update(1)
        


        ### BLAST
        if args.diamond_blastx:
            progress_bar.set_description("Running BLASTx")
            diamond_blastx(args.outdir, args.diamond_blastx, args.cpu, args.diamond_path)
            progress_bar.update(1)
        if args.blastn:
            progress_bar.set_description("Running BLASTn")
            blastn(args.outdir, args.blastn, args.cpu)
            progress_bar.update(1)

        ### Final table
        progress_bar.set_description("Generating final table")
        finalTable(args.outdir)
        progress_bar.update(1)

        ### HTML report
        progress_bar.set_description("Generating HTML report")
        generate_html_report(args.outdir)
        progress_bar.update(1)       

    time_end = time.time()
    print(f"The pipeline takes {time_end - time_start:.2f} seconds to run.")


    ### log file ###
    name = os.path.basename(args.input)
    name = name.replace(".fasta",".log")
    log_path = os.path.join(args.outdir, name)

    with open(log_path, "a") as log_file:
      log_file.write(f"""ViralQuest v{__version__} --- Start in: {time.strftime('%Y-%m-%d %H:%M:%S')}
#############################################
Input file: {args.input}
Output directory: {args.outdir}
Number of ORFs: {args.numORFs}
CPU cores: {args.cpu}
BLASTn database: {args.blastn}
Diamond BLASTx database: {args.diamond_blastx}
RVDB hmm profile database: {args.rvdb_hmm}
Pfam hmm profile database: {args.pfam_hmm}
#############################################

The pipeline takes {time_end - time_start:.2f} seconds to run.
    """)


if __name__ == "__main__":
    ViralQuest()

